import React, { useState } from 'react';
import logo from './logo.svg';
import './App.css';
import Header from './component/header';
import { Container, Row, Col,ButtonGroup, Dropdown } from 'react-bootstrap';
import './App.css';

function App() {
  const [showProperty, setShowProperty] = useState('show');

  return (
    <Container fluid='sm'>
      <Header />
      <Row>
        <Col md={5} xs={12}>
          <Dropdown as={ButtonGroup} className="width-100 bg-color">
            <Dropdown.Toggle className="width-100 bg-color">Pow! Zoom!</Dropdown.Toggle>
            <Dropdown.Menu className="width-100">
              <Dropdown.Item eventKey="1">Action</Dropdown.Item>
              <Dropdown.Item eventKey="2">Another action</Dropdown.Item>
              <Dropdown.Item eventKey="3" active>
                Active Item
      </Dropdown.Item>
              <Dropdown.Divider />
              <Dropdown.Item eventKey="4">Separated link</Dropdown.Item>
            </Dropdown.Menu>
          </Dropdown>
        </Col>
        <Col md={{ span: 5, offset: 2 }} xs={12}>{`md={{ span: 4, offset: 4 }}`}</Col>
      </Row>
    </Container>
  );
}

export default App;
